import React from "react";

class UserInput extends React.Component
{
    constructor(props)
    {
        super(props);
        this.state = {value: ""};
        this.handleSubmit = this.handleSubmit.bind(this);
    };

    handleSubmit()
    {
        console.log("Submitted");
    };

    render(){
        return(
            <form>
                <input type={"text"}></input>
                <input type={"submit"}>
                    Input Command
                </input>
            </form>
        )
    };
};

export default UserInput;
